selector_to_html = {"a[href=\"#data-upload1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Carga de datos<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#clear-stored-barcode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Limpiar c\u00f3digo de barras almacenado<a class=\"headerlink\" href=\"#clear-stored-barcode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#working-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de trabajo<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>En el \u00e1rea de trabajo fuera del rango de los 2. G receptor o se\u00f1al Bluetooth, puede activar el modo de almacenamiento del esc\u00e1ner siguiendo los pasos descritos a continuaci\u00f3n. En este modo, todos los datos escaneados ser\u00e1n almacenados directamente en el esc\u00e1ner. Antes de subir los datos se guardar\u00e1 permanentemente en el esc\u00e1ner para que puedas subir los datos cuando el esc\u00e1ner est\u00e9 en el rango de se\u00f1al que recibe.</p>", "a[href=\"#id11\"]": "<figure class=\"align-center\" id=\"id11\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23On.png\"><img alt=\"../../media/25AutoSav23On.png\" src=\"../../media/25AutoSav23On.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Activar el modo de almacenamiento autom\u00e1tico</span><a class=\"headerlink\" href=\"#id11\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523INVMD.png\"><img alt=\"../../media/2523INVMD.png\" src=\"../../media/2523INVMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Modo de almacenamiento</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232BTCNT.png\"><img alt=\"../../media/25232BTCNT.png\" src=\"../../media/25232BTCNT.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Cantidad total de almacenamiento</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/25AutoSav23Off.png\"><img alt=\"../../media/25AutoSav23Off.png\" src=\"../../media/25AutoSav23Off.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Desactivar el modo de almacenamiento autom\u00e1tico</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523TXMEM.png\"><img alt=\"../../media/2523TXMEM.png\" src=\"../../media/2523TXMEM.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Carga de datos</span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523NORMD.png\"><img alt=\"../../media/2523NORMD.png\" src=\"../../media/2523NORMD.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modo Normal</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/25232ANEW2A.png\"><img alt=\"../../media/25232ANEW2A.png\" src=\"../../media/25232ANEW2A.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Limpiar c\u00f3digo de barras almacenado</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Durante la subida de datos, escaneando el comando \u00abCarga de datos\u00bb de nuevo cancelar\u00e1/detener la carga de datos.</p>\n</aside>", "a[href=\"#disable-automatic-storage-mode\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Desactivar el modo de almacenamiento autom\u00e1tico<a class=\"headerlink\" href=\"#disable-automatic-storage-mode\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>En modo de transmisi\u00f3n inal\u00e1mbrica, cuando el modo de almacenamiento autom\u00e1tico est\u00e1 encendido el c\u00f3digo de barras se almacenar\u00e1 autom\u00e1ticamente cuando la transmisi\u00f3n falle, y los datos almacenados se pueden obtener a trav\u00e9s de \u00abCarga de datos\u00bb.</p>\n</aside>", "a[href=\"#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#enable-automatic-storage-mode2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Activar el modo de almacenamiento autom\u00e1tico<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#enable-automatic-storage-mode2\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de almacenamiento<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Carga de datos<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#total-storage-quantity\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Cantidad total de almacenamiento<a class=\"headerlink\" href=\"#total-storage-quantity\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
